import React from 'react';

class Home extends React.Component {
    render() {
        return (
            <div className="main">
                <h2>Om mig</h2>
                <p>
                    Mitt namn är Johan Ledel, 27år gammal. Bor I halmstad och läser Webbprogrammering på BTH på Distans.

                </p>
            </div>
        )
    }
}

export default Home;
